import { createSelector } from 'reselect';

const selectTransactionsState = (state) => {
  console.log('State in selector:', state);
  return state.transactions;
};

export const selectAllTransactions = createSelector(
  [selectTransactionsState],
  (transactionsState) => {
    console.log('Transactions State:', transactionsState);
    const { byId, allIds } = transactionsState;

    console.log(allIds.map(id => byId[id]));
    return allIds.map(id => byId[id]);
  }
);
// Select a transaction by id

